import axinos from 'axios';

const url = 'https://covid19.mathdro.id/api'


const fetchData = async ()=>{
    try{
    const response = await axinos.get(url);
    const data = await JSON.parse(response);
    const confirmed = response.confirmed;
    const recovered = response.recovered;
    const deaths = response.deaths;
    const lastUpdate = response.lastUpdate;
    console.log('the people comfired that got cronovirus: ' + confirmed);
    } catch{
        console.log("err");
    }
}

fetchData();
